import React from 'react';
import './ShowHousing.css'
import '../../image//464.jpg';
import useFetch from '../../useFetch';
import { NumericFormat } from 'react-number-format';

const ShowHousing = () => {
const House_API = "http://26.90.237.200:3000/admin/house_type/read";
const { data } = useFetch(House_API);
        return (
          
<div class="container">
  <div class="">

    <div>{data.map(val => 
      <div class="card" key={val.ht_id}> 
      <p>โมเดล {val.name}</p> 
      <p>ขนาดพื้นที่ {val.usable_area}</p> 

      <NumericFormat
        value={val.start_price}
        allowLeadingZeros
        thousandSeparator=","
        displayType="text"
        renderText={(value) => <p>{value}</p>}/>

        <button className='button'> ดูรายละเอียด </button>

        <button className='button'> แก้ไข </button>
        

      </div>)}
    </div>
    
 
  </div>
</div>
              
   
        )        


  }

  export default ShowHousing;
